CREATE TABLE `bigquery-public-data.idc_v14.version_metadata`
(
  idc_version INT64 NOT NULL OPTIONS(description="IDC version number"),
  version_hash STRING NOT NULL OPTIONS(description="MD5 hash of hashes of collections in this version"),
  version_timestamp STRING NOT NULL OPTIONS(description="Version creation timestamp")
);

